import React from 'react';
import Log from './componentsel/Log';
import Logcr from './componentsel/Logcr';
import { Route } from 'react-router';
import './Login.css';

export default class Login extends React.Component {
  state = {
    login: [],
  };

  Ren = (em, ps) => {
    const newList = {
      email: em,
      password: ps,
      id: this.newId++,
    };
    this.setState(({ login }) => {
      const myLastTodo = [...login, newList];
      return { login: myLastTodo };
    });
  };

  render() {
    const { login } = this.state;
    return (
      <div className='login'>
        <Route path={'/Log'} exact component={Log} Ren={this.Ren} />
        {login.map((item) => {
          return <Logcr {...item} />;
        })}
      </div>
    );
  }
}
